DELIMITER $$
--
-- Events
--
CREATE DEFINER=`root`@`localhost` EVENT `auto_checkout_bookings` ON SCHEDULE EVERY 1 HOUR STARTS '2025-11-29 18:41:32' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    -- Auto checkout bookings where checkout_date has passed
    UPDATE bookings 
    SET status = 'Checked Out' 
    WHERE status = 'Checked In' 
      AND checkout_date < CURDATE()
      AND payment_status = 'Paid';
    
    -- Update room status to Available
    UPDATE rooms r
    INNER JOIN bookings b ON r.room_number = b.room_number
    SET r.status = 'Available'
    WHERE b.status = 'Checked Out'
      AND b.checkout_date < CURDATE()
      AND r.status = 'Occupied';
END$$

CREATE DEFINER=`root`@`localhost` EVENT `cancel_unpaid_bookings` ON SCHEDULE EVERY 1 DAY STARTS '2025-11-29 18:41:32' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    UPDATE bookings 
    SET status = 'Cancelled' 
    WHERE status = 'Pending' 
      AND payment_status = 'Unpaid'
      AND receptionist_status = 'accepted'
      AND TIMESTAMPDIFF(HOUR, created_at, NOW()) > 24;
END$$

